import React from 'react';

const Days = (props) =>{
  const {date, icon, min_temp, max_temp} = props;
  return (
    <>
      <div className='Days'>
        <h1>{date ? date : null}</h1>
        <div>
          <img src={icon} alt="no load"/>
        </div>
        <div>
          <h4>{min_temp ? min_temp : null}</h4>
          <h4>{max_temp ? max_temp : null}</h4>
        </div>
      </div>
    </>
  );
};

export default Days;
